import { useQuery } from "@tanstack/react-query";
import Post from "../post/post"

const ProfileFeed = () => {
    const { data: user, isFetched: isFetchedUser } = useQuery(['profileUser', { path: location.pathname }], 
    () => getUserByUrl(location.pathname));

    const { data: posts,  isFetched: isFetchedPosts} = useQuery(['profilePosts'], 
    () => getUserPostsById(user.id).then(data => 
        data.map(post => ({
            ...post, 
            ingredients: JSON.parse(post.ingredients),
            date: moment(post.date).format('YYYY-MM-DD HH:mm:ss')
        }))
    ), 
    {
        enabled: isFetchedUser
    });

    return (
        <>
            {isFetchedPosts ?
                posts.map(post => <Post postObj={post} key={post.id}/>)
                :
                <>
                </>
            }
        </>
    )
}

export default ProfileFeed;
